a196766ea07775f18ded69bd9e8d239f8cfd3ccc.actualSource:
public int compare(FileStatus a, FileStatus b) {
  if (a.getLen() < b.getLen())
    return -1;
  else if (a.getLen() == b.getLen())
    if (a.getPath().toString().equals(b.getPath().toString()))
      return 0;
    else
      return -1; 
  else
    return 1;
}
